import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

function TaskProgress(props){
    return(
        <div className={"task--progress"} id={props.tasky.id}>
         {/* empty space */} Ð²
        </div>
    );
}

function TaskDescription(props){
    return(
        <div className = {"task--description"}>
            <div className={"task--name"}>
                <p>{props.task.name}</p>
            </div>
            <TaskProgress tasky = {props.task} />
        </div>
    );
}

function App() {
    return (
    <div>
        tasks.map((task) => <TaskDescription task = {task}/>);
    </div>
    );
}

const tasks = [
    {
        name: "sketch",
        startTime: "April 22, 2019 23:39:00",
        finishTime: "April 27, 2019 23:39:00",
        id: "line0"
    },
    {
        name: "line",
        startTime: "April 27, 2019 23:39:00",
        finishTime: "May 1, 2019 23:39:00",
        id: "line1"
    },
    {
        name: "finish",
        startTime: "May 1, 2019 23:39:00",
        finishTime: "May 5, 2019 23:39:00",
        id: "line2"
    }
]

ReactDOM.render(<App/>, document.getElementById('root'))
